__NUXT_JSONP__("/archive/2021", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E){return {data:[{year:x}],fetch:{},mutations:[["setApp",{name:"Blog2",uid:"blog2",icon:{type:"emoji",value:"✌️"},cover:{type:"image",value:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-images\u002F618884b9b2f01f00183628e7%2F61edf6d5ee0ab10018964218%2Fcovers%2F1663668937942%2Fblog2.jpg"}}],["setTags",[{_id:y,_sys:{raw:{createdAt:b,updatedAt:z,firstPublishedAt:b,publishedAt:b},createdAt:b,updatedAt:b},name:A,slug:B,total:1},{_id:m,_sys:{raw:{createdAt:c,updatedAt:n,firstPublishedAt:c,publishedAt:f},createdAt:c,updatedAt:f},name:o,slug:p,total:2}]],["setAuthors",[{_id:g,_sys:{raw:{createdAt:a,updatedAt:h,firstPublishedAt:a,publishedAt:e},createdAt:a,updatedAt:e},fullName:i,slug:j,biography:k,profileImage:l,total:q}]],["setArchives",[{year:2022,count:0},{year:x,count:q}]],["setArticles",[{_id:"61b1688832470a0018d79f4a",_sys:{raw:{createdAt:r,updatedAt:"2022-10-13T10:27:59.378Z",firstPublishedAt:r,publishedAt:C},createdAt:r,updatedAt:C},title:"Fictitiousをクイックにスタートする方法",slug:"article-3",body:"\u003Ch2\u003Eステップ1\u003C\u002Fh2\u003E\n\u003Cp\u003Eこのガイドでは、Appの作成からコンテンツの作成、APIでの取得まで順を追って紹介します。\u003Cbr\u003E\nまずはAppを追加しましょう。「Appを追加」から「新規作成」を選択します。\u003Ccode\u003EApp UID\u003C\u002Fcode\u003EはAPIで情報を取得する時のURLとして利用されます。ここで設定する情報は、あとで変更可能です。\u003C\u002Fp\u003E\n\u003Ch2\u003Eステップ2\u003C\u002Fh2\u003E\n\u003Cp\u003E「モデルを作成」を選択し、モデルを新規作成します。モデル UIDはAPIで情報を取得する時のURLとして利用されます。ここで設定する情報は、あとで変更可能です。続いて、モデルのフィールドを追加します。ここではタイトル（\u003Ccode\u003EフィールドID: title\u003C\u002Fcode\u003E）と本文（\u003Ccode\u003EフィールドID: body\u003C\u002Fcode\u003E）を設定しました。設定が終わったら、保存ボタンを押してください。\u003C\u002Fp\u003E\n\u003Cp\u003EAPIのエンドポイントは以下のようになっているため、まずプロジェクトUID・App UID・モデルUIDを確認します。\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode\u003Ehttps:\u002F\u002F{projectUid}.cdn.newt.so\u002Fv1\u002F{appUid}\u002F{modelUid}\n\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\n\u003Ch2\u003E最後にFictitiousの特徴を紹介します\u003C\u002Fh2\u003E\n\u003Col\u003E\n\u003Cli\u003EAppによる分かり易いサイト設計とコンテンツ管理\u003C\u002Fli\u003E\n\u003Cli\u003Eコンテンツに応じた管理画面の作成\u003C\u002Fli\u003E\n\u003Cli\u003Eコンテンツ管理をもっと楽しく。\u003C\u002Fli\u003E\n\u003Cli\u003EAppテンプレートで簡単スタート\u003C\u002Fli\u003E\n\u003C\u002Fol\u003E\n",coverImage:{_id:"632993eb0ee571716d9668a1",altText:d,description:d,fileName:"cinn-zzESehTH0Pk-unsplash.jpg",fileSize:226539,fileType:s,height:t,metadata:{},src:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-files\u002F1a2fc71b-a17f-4307-a513-66448a09ab23%2Fcinn-zzESehTH0Pk-unsplash.jpg",title:d,width:u},author:{_id:g,_sys:{raw:{createdAt:a,updatedAt:h,firstPublishedAt:a,publishedAt:e},createdAt:a,updatedAt:e},fullName:i,slug:j,biography:k,profileImage:l},tags:[{_id:y,_sys:{raw:{createdAt:b,updatedAt:z,firstPublishedAt:b,publishedAt:b},createdAt:b,updatedAt:b},name:A,slug:B}]},{_id:"61b1686732470a0018d79e97",_sys:{raw:{createdAt:v,updatedAt:"2022-10-13T10:27:59.748Z",firstPublishedAt:v,publishedAt:D},createdAt:v,updatedAt:D},title:"Fictitious Communityがパンデミックの間イベントをどのように主催したか",slug:"article-2",body:"\u003Ch2\u003EFictitiousコミュニティ\u003C\u002Fh2\u003E\n\u003Cp\u003Eコミュニティは常にFictitiousの中心でした。多くの人々がコミュニティに加わるにつれて、世界中のユーザーが独自のコミュニティを形成し始めまていました。\u003Cbr\u003E\nしかし、世界的なパンデミックがおき行動は制限されました。そんな中でもコミュニティは、世界中で素晴らしいイベントを何度も開催してくれました。\u003C\u002Fp\u003E\n\u003Cul\u003E\n\u003Cli\u003E4\u002F4 Fictitious Camp\u003C\u002Fli\u003E\n\u003Cli\u003E6\u002F9 Fictitious conference 2021\u003C\u002Fli\u003E\n\u003Cli\u003E9\u002F5 Meetup! Fictitious\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp\u003E\u003Cstrong\u003Eオンラインイベントの大きなチャンスは、より多くのオーディエンスにリーチできること\u003C\u002Fstrong\u003E。コミュニティは以前にもまして国際的になり、予想外の成長を遂げました。\u003C\u002Fp\u003E\n\u003Ch2\u003EThank you\u003C\u002Fh2\u003E\n\u003Cp\u003E今年イベントに参加してくださった皆様、ありがとうございました。来年もこの取り組みを継続するために取り組んでいきます。今後のイベントにも是非参加してください。リスト\u003C\u002Fp\u003E\n",coverImage:{_id:"632993fa0ee571716d967187",altText:d,description:d,fileName:"avel-chuklanov-9OWS4lT5iqQ-unsplash.jpg",fileSize:253326,fileType:s,height:t,metadata:{},src:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-files\u002F11924cc4-7afd-48c0-97c7-76f987e0fe26%2Favel-chuklanov-9OWS4lT5iqQ-unsplash.jpg",title:d,width:u},author:{_id:g,_sys:{raw:{createdAt:a,updatedAt:h,firstPublishedAt:a,publishedAt:e},createdAt:a,updatedAt:e},fullName:i,slug:j,biography:k,profileImage:l},tags:[{_id:m,_sys:{raw:{createdAt:c,updatedAt:n,firstPublishedAt:c,publishedAt:f},createdAt:c,updatedAt:f},name:o,slug:p}]},{_id:"61b1682a32470a0018d79d59",_sys:{raw:{createdAt:w,updatedAt:"2022-10-13T10:27:59.813Z",firstPublishedAt:w,publishedAt:E},createdAt:w,updatedAt:E},title:"Fictitious Communities Summit 2021のレポート",slug:"article-1",body:"\u003Ch2\u003EFictitiousの新機能の発表\u003C\u002Fh2\u003E\n\u003Cp\u003Eファウンダー兼CEOのDonna Thomasonから、Fictitiousの新機能を発表しました。また、Fictitiousをモバイルでも使える新しいツールも発表しました。\u003Ca href=\"#\"\u003E詳しくは、こちらをご覧ください。\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\u003Ch3\u003Eアワード受賞者\u003C\u002Fh3\u003E\n\u003Cp\u003E毎年Fictitious Community Acceleratorプログラムへの応募者から、すばらしいコミュニティビルダーを表彰しています。今年の受賞者はJohn Smith。Johnはパンデミックの最中にコミュニティを始め、1,000人以上の人々を集めて親切な話を共有しました。\u003C\u002Fp\u003E\n",coverImage:{_id:"632994040ee571716d967a44",altText:d,description:d,fileName:"hannah-busing-7UWVcLtrhNk-unsplash.jpg",fileSize:376730,fileType:s,height:t,metadata:{},src:"https:\u002F\u002Fstorage.googleapis.com\u002Fnewt-files\u002Fc1329f7d-ff39-448a-b023-dbee3c2a409f%2Fhannah-busing-7UWVcLtrhNk-unsplash.jpg",title:d,width:u},author:{_id:g,_sys:{raw:{createdAt:a,updatedAt:h,firstPublishedAt:a,publishedAt:e},createdAt:a,updatedAt:e},fullName:i,slug:j,biography:k,profileImage:l},tags:[{_id:m,_sys:{raw:{createdAt:c,updatedAt:n,firstPublishedAt:c,publishedAt:f},createdAt:c,updatedAt:f},name:o,slug:p}]}]],["setTotal",q]]}}("2021-12-01T08:43:09.433Z","2021-12-09T02:18:36.889Z","2021-12-01T09:05:32.437Z","","2022-02-17T04:05:10.247Z","2021-12-09T02:18:29.098Z","61a7359d8131ac001847fbb4","2022-10-13T10:27:59.876Z","Donna Thomason","donna-thomason","\u003Cp\u003E2020年にFictitiousを創業。前職のPetlassianではマーケティング責任者としてグローバル・マーケティングを担当し、オンライン販売モデルの構築・拡大に貢献\u003C\u002Fp\u003E",null,"61a73adc6c236700180c0da8","2022-10-13T10:28:00.209Z","Community","community",3,"2021-12-09T02:23:04.494Z","image\u002Fjpeg",667,1000,"2021-12-09T02:22:31.979Z","2021-12-09T02:21:30.173Z",2021,"61b1677c32470a0018d79abf","2022-10-13T10:28:00.057Z","Developers","developers","2022-09-20T10:20:37.691Z","2022-09-20T10:20:47.255Z","2022-09-20T10:20:59.606Z")));